\"mw-redirect\" title=\"1979\">1979<\/a>&#160;\u2014 30 \u0442\u044b\u0441\u044f\u0447 \u00ab\u043b\u043e\u0434\u043e\u0447\u043d\u0438\u043a\u043e\u0432\u00bb, \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043f\u043e \u043c\u043e\u0440\u044e \u043f\u043e\u043a\u0438\u043d\u0443\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u0412\u044c\u0435\u0442\u043d\u0430\u043c<\/a>, \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u043d\u0438\u0435 \u0432 \u0421\u0428\u0410.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987\" class=\"mw-redirect\" title=\"1987\">1987<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%BC%D0%BE%D1%80\" title=\"\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440\">\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440\u0435<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0445\u0438\u0440\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u043f\u0443\u0442\u0451\u043c \u0440\u0430\u0437\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B5_%D0%B1%D0%BB%D0%B8%D0%B7%D0%BD%D0%B5%D1%86%D1%8B\" title=\"\u0421\u0438\u0430\u043c\u0441\u043a\u0438\u0435 \u0431\u043b\u0438\u0437\u043d\u0435\u0446\u044b\">\u0441\u0438\u0430\u043c\u0441\u043a\u0438\u0435 \u0431\u043b\u0438\u0437\u043d\u0435\u0446\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989\" class=\"mw-redirect\" title=\"1989\">1989<\/a>&#160;\u2014 \u0418\u0437-\u0437\u0430 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043d\u043e\u0439 \u043e\u0448\u0438\u0431\u043a\u0438 41 \u0442\u044b\u0441. \u043f\u0430\u0440\u0438\u0436\u0430\u043d \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u043f\u0438\u0441\u044c\u043c\u0430, \u0438\u0437\u0432\u0435\u0449\u0430\u044e\u0449\u0438\u0435 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0438\u043c\u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u044b \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0430 \u0438 \u0433\u0440\u0430\u0431\u0435\u0436\u0438 \u0432\u043c\u0435\u0441\u0442\u043e \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u0439 \u043f\u0440\u0430\u0432\u0438\u043b \u0434\u043e\u0440\u043e\u0436\u043d\u043e\u0433\u043e \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991\" class=\"mw-redirect\" title=\"1991\">1991<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043f\u0440\u0438\u0437\u043d\u0430\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u041d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c\">\u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c<\/a> \u043f\u0440\u0438\u0431\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0445 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042d\u0441\u0442\u043e\u043d\u0438\u044f\">\u042d\u0441\u0442\u043e\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u044b<\/a>.<\/li><li>\u0413\u043e\u0440\u043e\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%